import React, {Fragment} from 'react';

const Patients = (records) => {
    console.log(records);
    if (records.length === 0) {
        return null;
    }
    return (
        <Fragment>
             <h1 className="my-5">Patient Administrator</h1>
             <div className="container mt-5 py-5">
                <div className="row">
                    <div className="col-12 mb-5 d-flex justify-content-center">
                        <a href="#" className="btn btn-success text-uppercase py-2 px-5 font-weight-bold"> New Record </a>
                    </div>
                    <div className="col-md-8 mx-auto">
                        <div className="list-goup">
                            {records.map(record => (
                                <h3 className="mb-3">{record.name}</h3>
                            ))}
                        </div>
                    </div>
                </div>
            </div>


        </Fragment>


    );
}

export default Patients;
